import React from 'react';
import './styles.css';

function Home() {
  return (
    <div id="home">
      <h1>Projeto Loopis criado com Create React App</h1>
      <span>
        edite o arquivo
        <b>src/pages/Home/index.js</b>
      </span>
    </div>
  );
}

export default Home;
